import { useState, useEffect } from 'react';
import axios from 'axios';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

function Analytics() {
  const [analytics, setAnalytics] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchAnalytics = async () => {
      try {
        const res = await axios.get('http://localhost:5000/api/analytics', {
          headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
        });
        setAnalytics(res.data);
      } catch (err) {
        console.error('Failed to fetch analytics');
      }
      setLoading(false);
    };
    fetchAnalytics();
  }, []);

  const followerData = {
    labels: ['Day 1', 'Day 2', 'Day 3', 'Day 4', 'Day 5', 'Day 6', 'Day 7'],
    datasets: [
      {
        label: 'Followers',
        data: analytics?.followers || [],
        borderColor: '#3b82f6',
        backgroundColor: 'rgba(59, 130, 246, 0.2)',
        fill: true,
        tension: 0.4,
      },
    ],
  };

  const handleExport = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/analytics/export', {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      const blob = new Blob([res.data], { type: 'application/json' });
      const url = URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = 'analytics.json';
      a.click();
      URL.revokeObjectURL(url);
    } catch (err) {
      console.error('Failed to export analytics');
    }
  };

  return (
    <div className="max-w-4xl mx-auto">
      <h2 className="text-xl font-semibold mb-4 text-gray-900 dark:text-white">Instagram Analytics</h2>
      {loading ? (
        <p className="text-gray-700 dark:text-gray-200">Loading...</p>
      ) : (
        <div className="space-y-6">
          <div className="chatgpt-card">
            <h3 className="text-lg font-semibold mb-4 text-gray-900 dark:text-white">Follower Growth (7 Days)</h3>
            <Line data={followerData} options={{ responsive: true, maintainAspectRatio: false }} />
          </div>
          <div className="chatgpt-card">
            <h3 className="text-lg font-semibold mb-4 text-gray-900 dark:text-white">Engagement Rate</h3>
            <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
              {analytics?.engagement.map((post) => (
                <div key={post.post} className="p-4 bg-gray-50 dark:bg-gray-700 rounded-lg">
                  <p className="text-gray-900 dark:text-white"><strong>Post {post.post}</strong></p>
                  <p className="text-gray-700 dark:text-gray-200">Likes: {post.likes}</p>
                  <p className="text-gray-700 dark:text-gray-200">Comments: {post.comments}</p>
                  <p className="text-gray-700 dark:text-gray-200">
                    Engagement Rate: {((post.likes + post.comments) / analytics.followers[6] * 100).toFixed(2)}%
                  </p>
                </div>
              ))}
            </div>
          </div>
          <div className="chatgpt-card">
            <h3 className="text-lg font-semibold mb-4 text-gray-900 dark:text-white">Best Time to Post</h3>
            <p className="text-gray-700 dark:text-gray-200">{analytics?.bestPostTime}</p>
          </div>
          <button
            onClick={handleExport}
            className="chatgpt-button"
          >
            Export Analytics
          </button>
        </div>
      )}
    </div>
  );
}

export default Analytics;
